    return this._code;
  }

  set code(newCode) {
    if (typeof newCode !== 'string') {
      throw new TypeError('new code must be a string');
    }
    this._code = newCode;
  }

  get name() {
    return this._name;
  }

  set name(newName) {
    if (typeof newName !== 'string') {
      throw new TypeError('new name must be a string');
    }
    this._name = newName;
  }

  displayFullCurrency() {
    const str = `${this._name} (${this._code})`;
    return str;
  }
}
